import React,{ useEffect} from 'react';
import {useParams} from "react-router";
import placeholderApi from '../../common/apis/placeholderApi';
import { showPhotos,getAllTitles } from '../../features/users/usersSlice';
import { useDispatch } from 'react-redux';
import { useSelector } from 'react-redux/es/exports';
import TitlesAlbums from '../TitlesAlbums/TitlesAlbums';
import '../UserListing/UserListing.scss';

const PhotosAlbum = () => {
  const {idAlbum} = useParams();
  const dispatch = useDispatch();
    useEffect(()=>{
        const fetchPhotosAlbums = async () => {
            const response = await placeholderApi.get(`albums/${idAlbum}/photos`)
            .catch((error)=>{
                console.log(error);
            });
            console.log("The Response from the API placeholder is: ",response);
            dispatch(showPhotos(response.data));
        }
        fetchPhotosAlbums();
    },[]);

    /*const titles = useSelector(getAllTitles);
    let renderTitles = "";
    //.log('Response state: ' ,posts);
       renderTitles = titles.length > 0 ? (
            titles.map((title, index)=>{
                 //console.log("array mapeado: ",title);
                return <TitlesAlbums key={index} data={title} />             
            })
        ) : (<div className="users-error"><h3> Error </h3></div>);*/
  
  return (
    <div className="user-wrapper">
            <div className="user-list">
                <h2>Fotos de Album</h2>
                <div className="user-container">
                           
                </div>
            </div>
        </div>
  )
}

export default PhotosAlbum
